"""
Input: Two strings, s and t where t is a substring of s.
Output: All locations of t in s.
"""

s = ""
t = "TACGATGTA"



#i_end =  len(s) - len(t)
motif_index = ""

for i in range(0,len(s)):
    subset = s[i:i+len(t)]    
    if subset == t:
        motif_index = motif_index + str(i+1) + " "
    else:
        pass
    
print(motif_index)


